import React from "react";
import { withStyles } from "@material-ui/core/styles";
import Button from "@material-ui/core/Button";
import Card from "@material-ui/core/Card";
import CardContent from "@material-ui/core/CardContent";

const styles = theme => ({
  HPSBlue: {
    backgroundColor: "#1C80B5",
    fontFamily: "'Roboto', 'Helvetica', 'Arial', sans-serif",
    fontSize: "18px",
    margin: theme.spacing.unit,
    color: "#FFFFF"
  },
  default: {
    backgroundColor: "#F0F0F0",
    fontFamily: "'Roboto', 'Helvetica', 'Arial', sans-serif",
    fontSize: "18px",
    margin: theme.spacing.unit,
    color: "#999794"
  },
  card: {
    maxWidth: 1080
  }
});
class LineOfBusiness extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      health1: false,
      dental1: false,
      vision1: false,
      travel1: false,
      health2: false,
      dental2: false,
      vision2: false,
      travel2: false,
      health3: false,
      dental3: false,
      vision3: false,
      travel3: false,
      health4: false,
      dental4: false,
      vision4: false,
      travel4: false
    };
  }
  changeColor = () => {
    if (this.state.individual === true) {
      this.setState({ individual: false });
    } else this.setState({ individual: true });
  };
  changeHealth1 = () => {
    if (this.state.health1 === true) {
      this.setState({ health1: false });
    } else this.setState({ health1: true });
  };
  changeHealth2 = () => {
    if (this.state.health2 === true) {
      this.setState({ health2: false });
    } else this.setState({ health2: true });
  };
  changeHealth3 = () => {
    if (this.state.health3 === true) {
      this.setState({ health3: false });
    } else this.setState({ health3: true });
  };
  changeHealth4 = () => {
    if (this.state.health4 === true) {
      this.setState({ health4: false });
    } else this.setState({ health4: true });
  };
  changeDental1 = () => {
    if (this.state.dental1 === true) {
      this.setState({ dental1: false });
    } else this.setState({ dental1: true });
  };
  changeVision1 = () => {
    if (this.state.vision1 === true) {
      this.setState({ vision1: false });
    } else this.setState({ vision1: true });
  };
  changeTravel1 = () => {
    if (this.state.travel1 === true) {
      this.setState({ travel1: false });
    } else this.setState({ travel1: true });
  };
  clear = () => {
    this.setState({ health1: false });
    this.setState({ dental1: false });
    this.setState({ vision1: false });
    this.setState({ travel1: false });
    this.setState({ health2: false });
    this.setState({ dental2: false });
    this.setState({ vision2: false });
    this.setState({ travel2: false });
    this.setState({ health3: false });
    this.setState({ dental3: false });
    this.setState({ vision3: false });
    this.setState({ travel3: false });
    this.setState({ health4: false });
    this.setState({ dental4: false });
    this.setState({ vision4: false });
    this.setState({ travel4: false });
  };
  render() {
    const { classes } = this.props;
    return (
      <div
        style={{
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          height: "100vh"
        }}
      >
        <Card className={classes.card}>
          <CardContent>
            <Button
              variant="outlined"
              onClick={this.changeHealth1}
              className={
                this.state.health1 === true ? classes.HPSBlue : classes.default
              }
            >
              Health
            </Button>
            <Button
              variant="outlined"
              onClick={this.changeDental1}
              className={
                this.state.dental1 === true ? classes.HPSBlue : classes.default
              }
            >
              Dental
            </Button>
            <Button
              variant="outlined"
              onClick={this.changeVision1}
              className={
                this.state.vision1 === true ? classes.HPSBlue : classes.default
              }
            >
              Vision
            </Button>
            <Button
              variant="outlined"
              onClick={this.changeTravel1}
              className={
                this.state.travel1 === true ? classes.HPSBlue : classes.default
              }
            >
              Travel
            </Button>
          </CardContent>
          <CardContent>
            <Button
              variant="outlined"
              onClick={this.changeHealth2}
              className={
                this.state.health2 === true ? classes.HPSBlue : classes.default
              }
            >
              Health
            </Button>
            <Button
              variant="outlined"
              onClick={this.changeDental2}
              className={
                this.state.dental2 === true ? classes.HPSBlue : classes.default
              }
            >
              Dental
            </Button>
            <Button
              variant="outlined"
              onClick={this.changeVision2}
              className={
                this.state.vision2 === true ? classes.HPSBlue : classes.default
              }
            >
              Vision
            </Button>
            <Button
              variant="outlined"
              onClick={this.changeTravel2}
              className={
                this.state.travel2 === true ? classes.HPSBlue : classes.default
              }
            >
              Travel
            </Button>
          </CardContent>
          <CardContent>
            <Button
              variant="outlined"
              onClick={this.changeHealth3}
              className={
                this.state.health3 === true ? classes.HPSBlue : classes.default
              }
            >
              Health
            </Button>
            <Button
              variant="outlined"
              onClick={this.changeDental3}
              className={
                this.state.dental3 === true ? classes.HPSBlue : classes.default
              }
            >
              Dental
            </Button>
            <Button
              variant="outlined"
              onClick={this.changeVision3}
              className={
                this.state.vision3 === true ? classes.HPSBlue : classes.default
              }
            >
              Vision
            </Button>
            <Button
              variant="outlined"
              onClick={this.changeTravel3}
              className={
                this.state.travel3 === true ? classes.HPSBlue : classes.default
              }
            >
              Travel
            </Button>
          </CardContent>
          <CardContent>
            <Button
              variant="outlined"
              onClick={this.changeHealth4}
              className={
                this.state.health4 === true ? classes.HPSBlue : classes.default
              }
            >
              Health
            </Button>
            <Button
              variant="outlined"
              onClick={this.changeDental4}
              className={
                this.state.dental4 === true ? classes.HPSBlue : classes.default
              }
            >
              Dental
            </Button>
            <Button
              variant="outlined"
              onClick={this.changeVision4}
              className={
                this.state.vision4 === true ? classes.HPSBlue : classes.default
              }
            >
              Vision
            </Button>
            <Button
              variant="outlined"
              onClick={this.changeTravel4}
              className={
                this.state.travel4 === true ? classes.HPSBlue : classes.default
              }
            >
              Travel
            </Button>
          </CardContent>
          <CardContent>
            <Button variant="outlined" onClick={this.clear}>
              Clear
            </Button>
          </CardContent>
        </Card>
      </div>
    );
  }
}
export default withStyles(styles)(LineOfBusiness);
